// src/pages/Home.jsx
import React, { useEffect } from "react";

export default function Home() {
  useEffect(() => {
    // Re-run AOS animations if using AOS (you can re-init here)
    // AOS.init();
  }, []);

  return (
    <div className="bg-white dark:bg-secondary text-purple-700 dark:text-white">
      {/* Hero Section */}
      <section className="text-center px-4 py-20">
        <h1 className="text-4xl md:text-6xl font-extrabold mb-4">
          We are skilled in <span className="text-primary">digital marketing</span>
        </h1>
        <p className="text-lg md:text-xl mb-6">
          "You've got a business, we have got brilliant minds. We impact your brand for you, hassle free."
        </p>
        <a href="/contact" className="btn inline-flex">Talk to Sales</a>
      </section>

      {/* Statistics Section */}
      <section className="grid grid-cols-2 md:grid-cols-4 gap-8 text-center py-16 bg-gray-50 dark:bg-purple-800">
        {[
          { value: "4.8k", label: "Jobs completed" },
          { value: "15+", label: "Industry experience" },
          { value: "3.6k", label: "Global client" },
          { value: "130+", label: "Awards winning" }
        ].map((item, i) => (
          <div key={i}>
            <h3 className="text-3xl font-bold mb-2">{item.value}</h3>
            <p>{item.label}</p>
          </div>
        ))}
      </section>

      {/* Services Preview */}
      <section className="py-16 px-4">
        <h2 className="text-2xl md:text-4xl font-bold text-center mb-10">
          High impact services to improve your business
        </h2>
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
          {[
            { title: "Website Optimization", color: "green" },
            { title: "Paid Media", color: "purple" },
            { title: "Email & SMS Marketing", color: "red" },
            { title: "Funnel Optimization", color: "pink" },
            { title: "Advanced Analytics", color: "yellow" },
          ].map((service, i) => (
            <div key={i} className="bg-white dark:bg-purple-900 rounded-lg p-6 shadow">
              <div className={`h-12 w-12 rounded-full bg-${service.color}/20 mb-4`} />
              <h3 className="font-semibold text-xl mb-2">{service.title}</h3>
              <p className="text-purple-600 dark:text-purple-400 text-sm">
                This is a sample description for {service.title}.
              </p>
            </div>
          ))}
        </div>
        <div className="text-center mt-10">
          <a href="/services" className="btn inline-flex bg-primary text-white">Browse all services</a>
        </div>
      </section>
    </div>
  );
}
